        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    La gestion de projet, dans sa forme moderne, n’a commencé à prendre racine que depuis quelques dizaines d’années. À partir du début des
                    années 1960, les entreprises ont commencé à réaliser l’utilité d’organiser le travail en projets. Cette vision de l’organisation axée sur les projets
                    s’est amplifiée lorsque les organisations ont commencé à prendre conscience de la nécessité essentielle pour leurs employés de communiquer et
                    de collaborer dans un contexte professionnel impliquant plusieurs services et pro");
            WriteLiteral(@"fessions et, dans certains cas, l’ensemble des secteurs industriels.
                    Fort de ce constant, Business Intelligence Institute a mis en place un programme de formation continue et initiale intitulé Gestion et pilotage de
                    projets pour répondre aux préoccupations des organisations.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    Le programme de Licence en Gestion et pilotage de projets est structuré autour de deux semestres indissociables et axés sur la conception ; la
                    planification et le suivi-évaluation de projets et programmes. L’objectif est de former des cadres aptes à s’auto employer ou à se faire employer
                    par les sociétés, cabinets d’études et ONG humanitaires, en leur appor");
            WriteLiteral(@"tant un socle de connaissances en gestion et pilotage de projets.                   
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’apprenant, à l’issue de ce programme sera capable de : <br/>
                </p>
                <ul class=""one_list"">
                    <li>  Travailler dans toutes les entreprises et ONG nationales et internationales; </li>
                    <li> Piloter un projet industriel, informatique, sanitaire etc. ; </li>
                    <li> Gérer, coordonner une équipe de recherche pour un but précis ; </li>
                    <li> Elaboration des projets et programmes ; </li>
                    <li> Planification stratégique et opérationnelle des différents projets ;</li>
                    <li> Elaboration des notes conceptuelles de projets </li>
                    <li> Capita");
            WriteLiteral(@"lisation des bonnes pratiques </li>
                    <li> Participer à l’élaboration des outils et des lignes directrices pour la collecte, la compilation et le rapportage des données d’activité (output) et résultats (outcome) ;</li>
                    <li> Fournir des rapports mensuel, trimestriel, et annuel de suivi et évaluation selon les formulaires pour diriger les décisions de gestion et programmation ; </li>
                    <li> Fournir des rapports réguliers sur la performance des systèmes de suivi et évaluation. </li>
                    <li> Concevoir, Organiser, planifier et suivre la mise en œuvre opérationnel des activités, des projets, des plans et des programmes d’un département au sein d’une société privée ou publique ; </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme prépare au parcours de Gestionnaire de projets et qui a pour but de préparer aux ");
            WriteLiteral(@"carrières dans le secteur privé.
                </p>

