                    et la direction académique. Les commissions d'évaluation sont placées sous la double responsabilité du directeur académique et du service en
                    charge de l’évaluation. Le processus d’évaluation requiert pour chaque unité d’enseignement une participation active des étudiants, directement
                    par réponse à un questionnaire et par la voie de représentants. La synthèse des informations recueillies par la commission d'évaluation contribue à
                    déterminer les adaptations à apporter à l’unité d’enseignement considéré et à faire évoluer l'offre d'enseignement.
